import logo from './logo.svg';
import './App.css';
import React, {useEffect, useState} from 'react';

function App() {
  const [data, setData] = useState({'slides':'','variables':''});
  useEffect(() => {
    fetch("http://localhost:7777/api/124124331124")
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
        setData(data)}) 
      .catch((error) => console.log(error.message));  
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <p>Value A: {[data.variables]}</p>
        <p>Value B: {[data.slides]}</p>
      </header>
    </div>
  );
}

export default App;
